import React from 'react';
import './style/App.css';
import Login from './components/Login'
import Cadastro from './components/Cadastro'

let rota = 'Login'

function App() {
    if (rota === 'Login') {
        return (
            <div className="App">
                <Login onCadastrar={rota = 'Cadastro'}/>
            </div>
        );
    } else if (rota === 'Cadastro') {
        return (
            <div className="App">
                <Cadastro/>
            </div>
        );
    }
}

export default App;
